import React, { useState, useEffect } from "react";
import axios from "axios";

function CompetitorAnalysis() {
  const [username, setUsername] = useState("");
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Function to fetch keyword analysis from backend
  const fetchKeywordAnalysis = async () => {
    try {
      console.log("Fetching keyword analysis from backend...");
      const response = await axios.get("http://localhost:5000/videos");
      console.log("Keyword Analysis Response:", response.data);
      setKeywordAnalysis(response.data);
    } catch (err) {
      console.error("Error fetching keyword analysis:", err);
      setError("Failed to fetch keyword analysis.");
    }
  };

  // Function to fetch competitor videos
  const fetchVideos = async () => {
    setLoading(true);
    setError(null);

    try {
      console.log(`Fetching videos for username: ${username}`);
      
      const videoResponse = await axios.post("http://localhost:5000/analyze", {
        username,
      });

      console.log("Video Response:", videoResponse.data);

      if (videoResponse.data.error) {
        throw new Error(videoResponse.data.error);
      }

      setChannelData({
        title: videoResponse.data.channelTitle,
        subscribers: videoResponse.data.subscriberCount,
      });

      setVideos(videoResponse.data.videos);
      
      // Fetch keyword analysis after fetching videos
      await fetchKeywordAnalysis();
    } catch (err) {
      console.error("Error fetching data:", err);
      setError("Failed to fetch data. Check the username and API.");
    }

    setLoading(false);
  };

  // Fetch keyword analysis on component mount
  useEffect(() => {
    fetchKeywordAnalysis();
  }, []);

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h2>Competitor Video Analysis</h2>
      <input
        type="text"
        placeholder="Enter Competitor's Channel Name"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{ padding: "8px", marginRight: "10px" }}
      />
      <button onClick={fetchVideos} style={{ padding: "8px" }}>
        Get Videos
      </button>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {channelData && (
        <div>
          <h3>Channel: {channelData.title}</h3>
          <p>Subscribers: {channelData.subscribers}</p>
        </div>
      )}

      <ul>
        {videos.map((video) => (
          <li key={video.videoId}>
            <a
              href={`https://www.youtube.com/watch?v=${video.videoId}`}
              target="_blank"
              rel="noopener noreferrer"
            >
              {video.title}
            </a>
            <p>
              Views: {video.views} | Likes: {video.likes} | Comments: {video.comments}
            </p>
          </li>
        ))}
      </ul>

      {keywordAnalysis && (
        <div>
          <h3>Keyword Analysis</h3>
          <p>
            <strong>Top Keywords:</strong> {keywordAnalysis.keywords?.join(", ")}
          </p>
          <p>
            <strong>Top Bigrams:</strong> {keywordAnalysis.bigrams?.join(", ")}
          </p>
          <p>
            <strong>Top Trigrams:</strong> {keywordAnalysis.trigrams?.join(", ")}
          </p>
          <p>
            <strong>TF-IDF Scores:</strong> {JSON.stringify(keywordAnalysis.tfidfScores)}
          </p>
          <p>
            <strong>Sentiment Score:</strong> {keywordAnalysis.avgSentiment}
          </p>
        </div>
      )}
    </div>
  );
}

export default CompetitorAnalysis;
